- input: "TEXT\x1CC00004606\x1CSA17.18571.TEXT\x1CSA17.18571\x1CSA17\x1CThere has
    been a discrepancy between our monthly FEC reports and our bank statement balance
    understating the actual amount on hand by $1,405.33. This discrepancy came to
    light during the FEC audit of the Kansas Republican Party in 2009 and 2010. The
    discrepancy was reflected on the settlement agreement, ADR 585, signed in January
    2012. It was further reflected in two certificates of reconciliation between our
    bank statements and FEC reports filed with the FEC in mid 2012 and mid 2013. To
    eliminate this discrepancy, we are adding the $1,405.33 amount to our year end
    report so that the ending report balance precisely reflects the bank balance of
    the Kansas Republican Party. We will continue to balance our monthly reports with
    our monthly bank statements. T.C. Anderson, Treasurer.\n"
